import React from 'react';
import restaurant1 from './restaurants1.jpeg'


class Restaurants extends React.Component {

    render() {
        return (
            <div class="container">
                <div class="row">
                    <div className="Restaurant1">
                        <img src={restaurant1}/>
                    </div>

                </div>
            </div>

        );
    }
}

export default Restaurants;
